    width: 150px;
    background-color: saddlebrown;
    list-style: none;
    display: flex;
    align-items: center;
    justify-content: left;
    font-size: 1.2rem;
`;

const Symbol = styled(NumberSymbol)`
    width: 30px;
    height: 30px;
    margin-right: 10px;
`;

function NavItem() {
